    try {
      const result = await axios.get(
        "https://jsonplaceholder.typicode.com/posts"
      );

      console.log("result", result);

      const res = result.map((row) => row);

      console.log("res", res);

      setList(res);
    } catch (error) {
      console.log(`error: ${error}`);
    }
  };
  return (
    <div>
      <ul>
        {list.map((item, idx) => (
          <li key={idx}>{item.id}</li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
